import axios from 'axios';

const GetApi = () => {
    axios.get('http://localhost:3001/Profiles')
    .then(resp => {
       let data = resp.data;
        data.map((element) => {
            console.log(`${element.id},${element.name},${element.place},${element.contact}`)
        });
    })  
    .catch(error => {
        console.log(error);
    });
    return(
        <>
        <div>
        {data.map((e) => {
                      return(
                        <div>
                          <p>{e.id}</p>
                          <p>{e.name}</p>
                          <p>{e.place}</p>
                          <p>{e.contact}</p>
                        </div>
                      )
              })}
        </div>
        </>
    )
}

export default GetApi;
